"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import useSound from "use-sound";
import mySound from './A_resonant_trimmed.wav'; 

const [playSound] = useSound(mySound);

function App() {

  return (
    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={playSound}/>
        <p className = "Centering">
          Centering
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
